	('5949','MSSQL_SERVER_AVAILABILITY','ARATest','CON','Allows testing of automated recovery actions without causing false alarms on parameters being monitored. You can set automated recovery actions through the KM Admin => Setup/Configure KM => ARA Settings menu command. You can test that setting through the ARA Settings => ARA Test menu command.','NA'),
	('5950','MSSQL_SERVER_AVAILABILITY','SuspectDatabases','STD','Determines which databases, if any, are marked as suspect (corrupt) by the SQL Server. This parameter only monitors databases that are setup for monitoring. However, when it goes into an alarm state, this parameter generates a report that lists all suspect databases, including those that are not monitored.','SuspectDatabases'),
