	('6037','MSSQL_SERVER_PERFORMANCE','ResponseSqlTime','CON','Provides the amount of time (in milliseconds) that it takes SQL Server to execute a simple query when a sample SQL statement is executed. This parameter is formed by subtracting the connect and disconnect times from the information gathered by ResponseColl, leaving only the amount of time that the SQL Server took to execute the query.',' ResponseColl'),
	('6038','MSSQL_SERVER_PERFORMANCE','ResponseExecTime','CON','Provides the total operating response time (in milliseconds). The value of this parameter includes the time it takes a sample SQL statement to connect to SQL Server, execute a simple query, and return a response. See ResponseColl for information on how to change the sample SQL statement.',' ResponseColl'),
	('6039','MSSQL_SERVER_PERFORMANCE','CacheHitRatio','CON','Displays the percentage of requests for data that the SQL Server can satisfy from memory (data cache) rather than reading the data from a disk. To calculate this value, PATROL uses the SQL Server => Cache Hit Ratio performance counter for SQL Server 6.5 and the SQL Server:Buffer Manager => Buffer Cache Hit Ratio performance counter for SQL Server 7.0. For recommendations, see the online Help.',' SQLServerColl'),
