	('6059','MSSQL_SERVER_COLLECTORS','ReplicationColl','STD','Collects information about transactions that are delivered from the transaction log of the publication database to the distribution database and transactions that are delivered from the distribution database to the destination database; gathers information about the servers that subscribe to published articles; and it creates and destroys the Published and Subscribers application instances.','ReplicationColl'),
	('6060','MSSQL_SERVER_COLLECTORS','LongRunningTransColl','STD','Monitors the oldest open transaction. Long-running transactions are those transactions that are open for longer than one poll cycle of this parameter (the default poll cycle is 10 minutes). System Administrator or Database Administrator privileges are required for proper execution of this parameter.','LongRunningTransColl'),
	('6061','MSSQL_SERVER_COLLECTORS','DbSpaceColl','STD','Collects information on space used and space free for databases (SQL Server 6.5 and later) and for files and file groups (SQL Server 7.0 and later). It uses sp_spaceused to calculate the space available, based on the settings for the database; for example, maxsize or current size plus x percent. For more information, see the online Help.','DbSpaceColl'),
	('6062','MSSQL_SERVER_COLLECTORS','LocksColl','STD','Collects information about all the locks that are within SQL Server.','LocksColl'),
	('6063','MSSQL_SERVER_COLLECTORS','GlobalVarsColl','STD','Collects various SQL Server statistics using SQL Server global variables (for example, @@CPU_BUSY), then calculates the change in the value of these global variables between poll cycles. For more details, see the online Help.','GlobalVarsColl'),
	('6064','MSSQL_SERVER_COLLECTORS','ProcessColl','STD','Collects information about the status and number of processes that are running on the SQL Server.','ProcessColl'),
	('6065','MSSQL_SERVER_COLLECTORS','CheckConfiguration','STD','Ensures that the PATROL Agent default account exists and that it has SQL Server administrator privileges; installs the sp_patrol_ monitor and sp_patrol_user stored procedures in the SQL Server master database; ensures that the SQL Server performance counters are available to PATROL; gathers data on the availability of the global channel; and, upon a global channel failure, attempts to reconnect to the global channel.','CheckConfiguration'),
	('6066','MSSQL_SERVER_COLLECTORS','DbStructureColl','STD','Collects information about monitored databases. Creates and destroys database instances (SQL Server 6.5 and later) and file and file group instances (SQL Server 7.0 and later).','DbStructureColl'),
	('6067','MSSQL_SERVER_COLLECTORS','LogSpaceColl','STD','Collects information about the amount of log space used by the databases that PATROL for Microsoft SQL Server is monitoring. This parameter makes calculations based on DBCC SQLPERF (LOGSPACE) and takes into account the autogrow settings. For more details, see the online Help.','LogSpaceColl'),
	('6068','MSSQL_SERVER_COLLECTORS','ErrorLogColl','STD','Monitors the SQL Server error log for updates, and then filters new log entries for search strings that you entered by using the KM Admin => SQL Server Error Log Filter menu command. Error, Msg, and WARNING are the default search strings.','ErrorLogColl'),
	('6069','MSSQL_SERVER_COLLECTORS','MonProbUsers','STD','Collects information about processes that are blocking other processes (blocker processes) and processes that are idle. To determine the amount of time configured for blocker or idle processes, see KM Admin => User Monitoring Admin. This parameter does not monitor logins that you excluded from monitoring by using the KM Admin => User Monitoring Admin => Exclude Specific User menu command.','MonProbUsers'),
	('6070','MSSQL_SERVER_COLLECTORS','ObjectSizeColl','STD','Collects information about and monitors the size of database objects, and creates and destroys the Objects application instances.','ObjectSizeColl'),
	('6071','MSSQL_SERVER_COLLECTORS','ResponseColl','STD','Measures the amount of time it takes to connect to the SQL Server, execute a simple query, and return a response by executing and then monitoring the progress of a sample SQL statement. For more information, see the online Help.','ResponseColl'),
	('6072','MSSQL_SERVER_COLLECTORS','ProcedureCacheColl','STD','Collects information about the SQL Server procedure cache. To calculate the values for the procedure cache consumer parameters, this parameter uses the SQL Server - Procedure Cache performance object for SQL Server 6.5 and the SQL Server DBCC PROCCACHE command for SQL Server 7.0 and 2000.','ProcedureCacheColl'),
