	('6083','MSSQL_SERVER_USERS','UserBlocked','CON','Gives a warning if one user process is blocked longer than the blocked detection time. Goes into alarm when two or more user processes are blocked longer than the blocked detection time. Change the blocked detection time for all SQL Server user processes by using the KM Admin => User Monitoring Admin => Configure Auto User Monitoring menu command.Change the blocked detection time for the selected user process through the Change Local Defaults menu command.',' UserColl'),
