	('6099','NT_CPU','CPUprcrInterruptsPerSec','CON','Displays the number of device interrupts encountered by the processor. An interrupt occurs when a device has completed a task or when it requires attention. Normal thread execution is suspended during interrupts. An interrupt may cause the processor to switch to another, higher priority thread.',' CPUProcessorColl'),
