	('6102','NT_CPU','CPUprcrPrivTimePercent','CON','Displays the percentage of processor time spent in privileged mode in non-idle threads. Device drivers for most devices except graphics adapters and printers execute in privileged mode, as well as the Windows NT service layer, the executive routines, and the Windows NT kernel.',' CPUProcessorColl'),
