	('6110','NT_MEMORY','MEMmemAvailableBytes','CON','Displays the number of megabytes of physical memory currently available to processes, but is not related to the amount of physical memory installed in your server.',' MEMMemoryColl'),
	('6111','NT_MEMORY','MEMMemoryColl','COL','Collects memory statistics from the memory performance objects in the Windows Performance Database.','MEMMemoryColl'),
	('6112','NT_PAGEFILE_CONTAINER','PAGEPageColl','COL','Collects paging statistics from the paging file performance objects in the Windows Performance Database.','PAGEPageColl'),
	('6113','NT_PAGEFILE','PAGEpgUsagePercentTotal','CON','Displays the percentage of the page file currently in use. This value is an average percentage of all the page files on the system. The parameter PAGEpgUsagePercent shows individual page file usage.',' PAGEPageColl'),
	('6114','NT_PAGEFILE','PAGEBadConfiguration','CON','A text parameter that displays error messages when the total page size is smaller than the real memory in the system. If the real memory on the system is 2GB or greater, the PAGEBadConfiguration parameter is not active. To disable this parameter, set the following pconfig variable as shown:',' PAGEPageColl'),
