	('6194','NT_SECURITY','SECsvrErrorsAccessPermissions','CON','Displays the number of times people attempted to open files and failed because of insufficient permissions to the file. A high number of failures can indicate that someone is trying to randomly access files that are not adequately protected.',' SVRServerColl'),
