	('6291','NT_NETBEUI','BEUbeuPiggybackAckQuePerSec','CON','Displays the rate that piggybacked acknowledgements are queued. A piggyback acknowledgement is an acknowledgement to a received packet that is sent along in an outgoing packet to the remote computer. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' BEUNetBEUIColl'),
