	('6348','NT_ICMP','ICMPicmpRcvdDestUnreachable','CON','DIsplays the number of ICMP Destination Unreachable messages received.',' ICMPIcmpColl'),
	('6349','NT_ICMP','ICMPicmpMessagesRcvdErrors','CON','Displays the number of ICMP messages that the entity received but determined as having errors (bad ICMP checksums, bad length, etc.).',' ICMPIcmpColl'),
	('6350','NT_ICMP','ICMPicmpMessagesPerSec','CON','Displays the total rate that ICMP messages are received and sent by the entity. The rate includes those messages received or sent in error.',' ICMPIcmpColl'),
	('6351','NT_ICMP','ICMPicmpMessagesSentPerSec','CON','Displays the rate at which sending ICMP messages is attempted by the entity. The rate includes those messages sent in error.',' ICMPIcmpColl'),
	('6352','NT_ICMP','ICMPicmpMessagesRcvdPerSec','CON','Displays the rate that ICMP messages are received by the entity. The rate includes those messages received in error.',' ICMPIcmpColl'),
	('6353','NT_ICMP','ICMPicmpMessagesOutboundErrors','CON','Displays the number of ICMP messages that this entity did not send due to problems discovered within ICMP such as lack of buffers. This value should not include errors discovered outside the ICMP layer such as the inability of IP to route the resultant datagram. In some implementations there may be no types of error that contribute to this counters value.',' ICMPIcmpColl'),
	('6354','NT_ICMP','ICMPIcmpColl','COL','Collects ICMP statistics from the NT ICMP object.','ICMPIcmpColl'),
	('6355','NT_IP','IPIpColl','COL','Collects TCP/IP statistics.','IPIpColl'),
	('6356','NT_IP','IPipDatagsRcvdPerSec','CON','Displays the rates that IP datagrams are received from the interfaces, including those in error.',' IPIpColl'),
	('6357','NT_IP','IPipDatagsRcvdHeaderErrors','CON','Displays the number of input datagrams discarded due to errors in their IP headers, including bad checksums, version number mismatch, other format errors, time-to-live exceeded, errors discovered in processing their IP options, etc.',' IPIpColl'),
	('6358','NT_IP','IPipDatagsRcvdAddressErrors','CON','Displays the number of input datagrams discarded because the IP address in their IP headers destination field was not a valid address to be received at this entity. This value includes invalid addresses (e.g., 0.0. 0.0) and addresses of unsupported Classes (e.g., Class E). For entities that are not IP Gateways and therefore do not forward datagrams, this counter includes datagrams discarded because the destination address was not a local address.',' IPIpColl'),
	('6359','NT_IP','IPipDatagsForwardedPerSec','CON','Displays the rate of input datagrams for which this entity was not their final IP destination, as a result of which an attempt was made to find a route to forward them to that final destination. In entities that do not act as IP Gateways, this rate will include only those packets that were Source-Routed via this entity, and the Source-Route option processing was successful.',' IPIpColl'),
	('6360','NT_IP','IPipDatagsRcvdUnknownProtocol','CON','Displays the number of locally-addressed datagrams received successfully but discarded because of an unknown or unsupported protocol.',' IPIpColl'),
	('6361','NT_IP','IPipDatagsRcvdDiscarded','CON','Displays the number of input IP datagrams for which no problems were encountered to prevent their continued processing, but which were discarded (e.g., for lack of buffer space). This value does not include any datagrams discarded while awaiting re-assembly.',' IPIpColl'),
	('6362','NT_IP','IPipDatagsRcvdDeliveredPerSec','CON','Displays the rate that input datagrams are successfully delivered to IP user-protocols (including ICMP).',' IPIpColl'),
	('6363','NT_IP','IPipDatagsSentPerSec','CON','Displays the rate that IP datagrams are supplied to IP for transmission by local IP user-protocols (including ICMP). It does not include any datagrams counted in IPipDatagsForwardedPerSec.',' IPIpColl'),
	('6364','NT_IP','IPipDatagsOutboundDiscarded','CON','Displays the number of output IP datagrams for which no problems were encountered to prevent their transmission to their destination, but which were discarded (for example, because of lack of buffer space.) This counter would include datagrams counted in Datagrams Forwarded if any such packets met this (discretionary) discard criterion.',' IPIpColl'),
	('6365','NT_IP','IPipDatagsOutboundNoRoute','CON','Displays the number of IP datagrams discarded because no route could be found to transmit them to their destination. This value includes any packets counted in Datagrams Forwarded that meet this `no route criterion.',' IPIpColl'),
	('6366','NT_IP','IPipFragsRcvdPerSec','CON','Displays the rate that IP fragments that need to be re-assembled at this entity are received. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPIpColl'),
	('6367','NT_IP','IPipFragsReassembledPerSec','CON','Displays the rate that IP fragments are successfully re-assembled. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPIpColl'),
	('6368','NT_IP','IPipFragsReassemblyFailures','CON','Displays the number of failures detected by the IP re-assembly algorithm (for whatever reason: timed out, errors, etc.) This is not necessarily a count of discarded IP fragments since some algorithms (notably RFC 815) can lose track of the number of fragments by combining them as they are received. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPIpColl'),
	('6369','NT_IP','IPipFragedDatagsPerSec','CON','Displays the rate that datagrams are successfully fragmented at this entity. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPIpColl'),
	('6370','NT_IP','IPipFragFailures','CON','Displays the number of IP datagrams that have been discarded because they needed to be fragmented at this entity but could not be, e.g., because their `Dont Fragment flag was set. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPIpColl'),
	('6371','NT_IP','IPipFragsCreatedPerSec','CON','Displays the rate that IP datagram fragments have been generated as a result of fragmentation at this entity. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPIpColl'),
	('6372','NT_IPX','IPXipxPktsSentPerSec','CON','Displays the rate that packets are sent by the computer. This value includes all packets (control and data) processed.',' IPXIpxColl'),
	('6373','NT_IPX','IPXIpxColl','COL','Collects IPX statistics from the IPX performance objects in the Windows Performance Database.','IPXIpxColl'),
	('6374','NT_IPX','IPXipxBytesTotalPerSec','CON','Displays the frame bytes and datagram bytes per second. This is the total rate of bytes sent to or received from the network by the protocol, counting only the bytes in frames (packets) which carry data. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPXIpxColl'),
	('6375','NT_IPX','IPXipxConnectionSessTimeouts','CON','Displays the number of connections that were dropped due to a session timeout. This number is an accumulator and shows a running total.',' IPXIpxColl'),
