	('6378','NT_IPX','IPXipxConnectionsOpen','CON','Displays the number of connections currently open for this protocol.',' IPXIpxColl'),
	('6379','NT_IPX','IPXipxConnectionsWithRetries','CON','Displays the number of connections that were made after retrying the attempt. A retry occurs when the first connection attempt failed.',' IPXIpxColl'),
	('6380','NT_IPX','IPXipxDatagBytesRcvdPerSec','CON','Displays the datagram bytes per second that are received by the computer. A datagram is a connectionless packet whose delivery to a remote computer is not guaranteed. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPXIpxColl'),
	('6381','NT_IPX','IPXipxDatagBytesSentPerSec','CON','Displays the datagram bytes per second that are sent from the computer. A datagram is a connectionless packet whose delivery to a remote computer is not guaranteed. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPXIpxColl'),
	('6382','NT_IPX','IPXipxDatagBytesPerSec','CON','Displays the datagram bytes per second that are processed by the computer. This number is the sum of datagrams bytes that are sent or received. A datagram is a connectionless packet whose delivery to a remote computer is not guaranteed. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPXIpxColl'),
	('6383','NT_IPX','IPXipxDatagsRcvdPerSec','CON','Displays the datagrams per second that are received by the computer. A datagram is a connectionless packet whose delivery to a remote computer is not guaranteed. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPXIpxColl'),
	('6384','NT_IPX','IPXipxDatagsSentPerSec','CON','Displays the datagrams per second that are sent from the computer. A datagram is a connectionless packet whose delivery to a remote computer is not guaranteed. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPXIpxColl'),
	('6385','NT_IPX','IPXipxDatagsPerSec','CON','Displays the datagrams per second that are processed. This number is the sum of datagrams sent and received. A datagram is a connectionless packet whose delivery to a remote computer is not guaranteed. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPXIpxColl'),
	('6386','NT_IPX','IPXipxDisconnectsLocal','CON','Displays the number of session disconnections that were initiated by the local computer. This parameter is inactive by default. You can activate this parameter from the PATROL Console KM tab.',' IPXIpxColl'),
