	('6564','ORACLE_AVAILABILITY','ConnectCheck','COL','Checks for a timestamp that is set for the ConnectDB parameter. It then compares the timestamp from the current time to see if more than 2 minutes have passed. This helps determine if a database is hung, and if it is, the channel used by ConnectDB is closed.','ConnectCheck'),
	('6565','ORACLE_AVAILABILITY','ConnectDB','STD','Displays whether the database connection via the PATROL channel is active. If the parameter cannot connect to the database, it goes into alarm.','ConnectDB'),
	('6566','ORACLE_AVAILABILITY','CannotExtend','CON','Displays whether a segment in an autoextensible tablespace cannot extend due to a lack of operating system space or reaching the maximum space on the tablespace. Onlypermanent autoextensible tablespaces are monitored; if a non-autoextensible tablespace cannot extend, the FreeSpaceDeficit parameter goes into alarm.',' CollAvailability'),
	('6567','ORACLE_AVAILABILITY','ShutdownInProgress','CON','Reports if the database is in the process of shutting down.',' CollAvailability'),
	('6568','ORACLE_AVAILABILITY','SchedulerOutput','CON','Reports the results of any jobs from the Scheduler that were specified to be sent to an annotation. If a report was sent to an annotation, the annotated data point will appear at the time the job or report was supposed to run.',' CollAvailability'),
	('6569','ORACLE_AVAILABILITY','SystemTSLeftETF','CON','Shows how long until there is no more space left in the SYSTEM tablespace. The annotation shows the day and time to failure or the reason data calculation cannot be done.',' CollETF'),
	('6570','ORACLE_AVAILABILITY','FreeSpaceETF','CON','Shows how long until there is no free space left in the non-excluded tablespaces.The annotation shows the day and time to failure or the reason data calculation cannot be done.',' CollETF'),
	('6571','ORACLE_AVAILABILITY','ExtentsLeftETF','CON','Reports how long until no more extents can be added to a non-excluded object in a non-excluded user schema in a non-excluded tablespace that is running out of extents. The annotation shows the day and time to failure or the reason data calculation cannot be done.',' CollETF'),
	('6572','ORACLE_AVAILABILITY','ArchFreeSpaceETF','CON','Shows how long until no more archive logs can fit in the amount of free space remaining on the primary archive destination device. The annotation shows the day and time to failure or the reason data calculation cannot be done. This parameter is not active for a remote instance and is not online if operating system components are not running.',' CollETF'),
	('6573','ORACLE_AVAILABILITY','SystemTSLeftPct','CON','Displays the percentage of space left in the SYSTEM tablespace. If the SYSTEM tablespace is autoextensible, this parameter is deactivated.',' CollAvailability'),
	('6574','ORACLE_AVAILABILITY','RSSpaceLeftPct','CON','Reportsthe percentage of space left in non-excluded table spaces with the least amount of space left that contain rollback segments.',' CollAvailability'),
	('6575','ORACLE_AVAILABILITY','RSExtentsLeftPct','CON','Reports the minimum space left (in MB) in non-excluded tablespaces which contain rollback segments. If all the non-excluded tablespaces with rollback segments are autoextensible (other than the SYSTEM tablespace), this parameter is deactivated.',' CollAvailability'),
	('6576','ORACLE_AVAILABILITY','ExtentsLeftPct','CON','Graphs the percentage of extents that are left in a non-excluded object in a non-excluded user schema in a non-excluded tablespace. Tablespace, user and object exclusion are used in the calculations, and does not consider rollback segments.',' CollAvailability'),
	('6577','ORACLE_AVAILABILITY','InstanceStatus','CON','Displays status changes for the server instance.',' InstanceStatusMonitor'),
	('6578','ORACLE_AVAILABILITY','SystemTSLeft','CON','Reports the megabytes left in the SYSTEM tablespace.',' CollAvailability'),
	('6579','ORACLE_AVAILABILITY','RSSpaceLeft','CON','Reports the minimum space left (in MB) in non-excluded tablespaces which contain rollback segments. If all the non-excluded tablespaces with rollback segments are autoextensible (other than the SYSTEM tablespace), this parameter is deactivated.',' CollAvailability'),
	('6580','ORACLE_AVAILABILITY','RSExtentsLeft','CON','Reports the number of additional extents that are available to any rollback segment on the instance.',' CollAvailability'),
	('6581','ORACLE_AVAILABILITY','LockConflicts','CON','The LockConflicts parameter provides all lock details for transation, DML, and PL/SQL locks.',' CollAvailability'),
	('6582','ORACLE_AVAILABILITY','FreeSpaceDeficit','CON','Indicates whether there is at least one segment that cannot allocate its next extent because of insufficient space. When this parameter alarms, the annotation reports all segments with insufficient available space.',' CollAvailability'),
	('6583','ORACLE_AVAILABILITY','FreeSpace','CON','Shows the percentage of space available in the non-excluded tablespace with the least amount of free space. When this parameter goes into alarm, the Free Space report for the tablespaces appears as the annotation.',' CollAvailability'),
	('6584','ORACLE_AVAILABILITY','ExtentsLeft','CON','Reports the number of extents that can be added to the non-excluded object in a non-excluded user schema in a non-excluded table space that has the least number of extents left.',' CollAvailability'),
	('6585','ORACLE_AVAILABILITY','ArchFreeSpace','CON','Shows the number of archive logs that can fit in the amount of free space remaining on the archive destination device. If the automated recovery actions have been set, that action will be taken when this parameter goes into alarm. The annotation displays the destination device, the space used and the space left on the device.',' CollAvailability'),
	('6586','ORACLE_AVAILABILITY','Alerts','STD','Shows the severity of the most recent Oracle error that was written to the alert log for this instance. Alarm means an Oracle error in the 00600–00639 range was found in the alert log; warning means that an Oracle error with the filter you specified has been found.','Alerts'),
	('6587','ORACLE_COLLECTORS','CollTempTS','CON','Reports any problems with the collection process for the temporary tablespace parameters in the AVAILABILITY application. The annotation reports the nature of any problem with the collection process and an event is raised.',' CollTempTS'),
