	('6594','ORACLE_COLLECTORS','CollPQO','CON','Reports any problems with the collection process for the parameters in the PQO application. The annotation reports the nature of any problem with the collection process, and an event is raised.',' CollPQO'),
	('6595','ORACLE_COLLECTORS','CollNetwork','CON','Reports any problems with the collection process for the parameters in the NETWORK application. The annotation reports the nature of any problem with the collection process, and an event is raised.',' CollNetwork'),
