	('6597','ORACLE_COLLECTORS','CollLog','CON','Reports any problems with the collection process for the parameters in the LOG application. The annotation reports the nature of any problem with the collection process, and an event is raised.',' CollLog'),
	('6598','ORACLE_COLLECTORS','CollJobs','CON','Reports any problems with the collection process for the parameters in the JOBS application. The annotation reports the nature of any problem with the collection process, and an event is raised.',' CollJobs'),
	('6599','ORACLE_COLLECTORS','CollEnvironment','CON','Reports any problems with the collection process for the parameters in the ENVIRONMENT application. The annotation reports the nature of any problem with the collection process, and an event is raised.',' CollEnvironment'),
