	('6601','ORACLE_COLLECTORS','CollDbLinks','CON','Reports any problems with the collection process for the parameters in the DB_LINKS application.',' CollDbLinks'),
	('6602','ORACLE_COLLECTORS','CollCapacity','CON','Reports any problems with the collection process for the parameters in the CAPACITY application. The annotation reports the nature of any problem with the collection process, and an event is raised.',' CollCapacity'),
	('6603','ORACLE_COLLECTORS','CollAvailability','CON','Reports any problems with the collection process for the parameters in the AVAILABLITY application. The annotation reports the nature of any problem with the collection process, and an event is raised.',' CollAvailability'),
	('6604','ORACLE_COLLECTORS','CollSqlViewer','CON','Displays the status of the SQLViewer application and the status of the CollSqlViewer parameter collection. The annotation reports the nature of any problem with the collection process and an event is raised.',' CollSqlViewer'),
	('6605','ORACLE_CAPACITY','UserDumpLeftETF','CON','Reports how long until there are no megabytes left in the file system, device or mount point containing the user dump directory for the monitored Oracle Server. The annotation shows the day and time to failure or the reason data calculation cannot be done.',' CollETF'),
	('6606','ORACLE_CAPACITY','SessionsLeftETF','CON','Shows how many additional user sessions will be allowed by the instance in its current configuration. The annotation shows the day and time to failure or the reason data calculation cannot be done.',' CollETF'),
	('6607','ORACLE_CAPACITY','ProcsLeftETF','CON','Shows how long until the instance can support no more processes. The annotation shows the day and time to failure or the reason data calculation cannot be done.',' CollETF'),
	('6608','ORACLE_CAPACITY','CoreDumpLeftETF','CON','Reports how long until there is no more space available in the core dump directory for the monitored Oracle Server. The annotation shows the day and time to failure or the reason data calculation cannot be done.',' CollETF'),
	('6609','ORACLE_CAPACITY','BGDumpLeftETF','CON','Reports how long until there is no space left in the background dump directory for the monitored Oracle server. The annotation shows the day and time to failure or the reason data calculation cannot be done.',' CollETF'),
	('6610','ORACLE_CAPACITY','UserDumpUsedPct','CON','Reports the percentage of space used in the user dump directory for the monitored Oracle Server. This parameter is not active for a remote instance and is not online if operating system components are not running.',' CollCapacity'),
