	('6612','ORACLE_CAPACITY','BGDumpUsedPct','CON','Reports the percentage of space used by trace files in the background dump directory for the monitored Oracle Server. This parameter is not active for a remote instance and is not online if operating system components are not running.',' CollCapacity'),
	('6613','ORACLE_CAPACITY','LicenseLimit','CON','Graphs how many concurrent sessions as set by the LICENSE_MAX_SESSIONS parameter can connect to an instance.',' CollCapacity'),
	('6614','ORACLE_CAPACITY','UserDumpUsed','CON','Reports the space in megabytes that has been used in the used dump directory for the Oracle server. This parameter is not active for a remote instance and is not online if operating system components are not running.',' CollCapacity'),
	('6615','ORACLE_CAPACITY','UserDumpLeft','CON','Reports the space in megabytes that is left in the file system, device, or mount point that contains the user dump directory for the Oracle instance. The annotation reports the destination of the user dump directory, the space used, and the free space left in the directory. This parameter is not active for a remote instance and is not online if operating system components are not running.',' CollCapacity'),
	('6616','ORACLE_CAPACITY','TransUsed','CON','Reports the percentage of total allowed transactions that have been used for the Oracle instance.',' CollCapacity'),
	('6617','ORACLE_CAPACITY','TransLeft','CON','Reports the number of transactions that are available to be started against the Oracle instance. The annotation reports the total number of transactions by user in descending order.',' CollCapacity'),
