	('6619','ORACLE_CAPACITY','SessionsLeft','CON','Reports how many additional user sessions can be allowed by the instance using the current configuration for the instance. The annotation reports the total number of sessions by user in descending order.',' CollCapacity'),
	('6620','ORACLE_CAPACITY','ProcsUsed','CON','Reports the ratio of current Oracle processes to the total number of processes allowed for the Oracle server. If the ratio is too high, there are not enough processes left on the Oracle server.',' CollCapacity'),
	('6621','ORACLE_CAPACITY','ProcsLeft','CON','Reports the number of additional processes that the instance can support. If this parameter alarms, the instance cannot support many more additional processes. The annotation reports the total number of processes by user in descending order.',' CollCapacity'),
	('6622','ORACLE_CAPACITY','LocksUsed','CON','Reports the percentage of used enqueue resources.',' CollCapacity'),
