	('6625','ORACLE_CAPACITY','CoreDumpUsed','CON','Reports the space in megabytes used in the core dump directory for the Oracle server.',' CollCapacity'),
	('6626','ORACLE_CAPACITY','CoreDumpLeft','CON','Reports the space in megabytes that is left in the file system, device, or mount point that contains the core directory for the Oracle instance. This parameter is not active for a remote instance and is not online if operating system components are not running.',' CollCapacity'),
	('6627','ORACLE_CAPACITY','BGDumpUsed','CON','Reports the space used in megabytes by trace files in the background dump directory for the Oracle server. This parameter is not active for a remote instance and is not online if operating system components are not running.',' CollCapacity'),
	('6628','ORACLE_CAPACITY','BGDumpLeft','CON','Reports the space in megabytes that is left in the file system, device, or mount point that contains the background dump directory for the Oracle instance.',' CollCapacity'),
