	('6635','ORACLE_ENVIRONMENT','BlkUpdRatio','CON','Reports the percentage of consistent gets and database block gets that are block changes.',' CollEnvironment'),
	('6636','ORACLE_ENVIRONMENT','BlkGetsTrans','CON','Reports the average number of block visits per transaction for all the transactions on the instance.',' CollEnvironment'),
