	('6639','ORACLE_JOBS','OverdueJobs','CON','Displays the number of jobs that are more than 2 minutes late. These jobs may be delayed, broken, or failed.',' CollJobs'),
	('6640','ORACLE_JOBS','FailedJobs','CON','Shows any job considered a failure. A job is marked as a failed job if Oracle has failed to successfully execute the job. If a job fails 16 times, it is considered a broken job.',' CollJobs'),
	('6641','ORACLE_JOBS','BrokenJobs','CON','Shows any job flagged as broken. A job is labelled as either broken or not broken. Oracle does not attempt to run broken jobs.',' CollJobs'),
	('6642','ORACLE_LOG','ArchLogCreated','CON','Alarms when a new archive log has been created, and calculates the number of archive logs created since the last polling cycle. The annotation for this parameter reports the thread number, sequence number, and the full pathname of the log file.',' CollLog'),
