	('6646','ORACLE_LOG','RedoNotArch','CON','Reports the number of redo log files that have been written but not yet archived, excluding the current online redo log file. When this parameter alarms, the archiving process may be falling behind. This parameter can only be instantiated when the monitored instance is running in ARCHIVELOG mode.',' CollLog'),
	('6647','ORACLE_LOG','RedoEntrySize','CON','Reports the current average size of the redo log entries.',' CollLog'),
	('6648','ORACLE_LOG','RedoCopyLatch','CON','Reports the percentage of requests on the redo copy latch that have timed out. The annotation reports the delta values used in the calculation.',' CollLog'),
	('6649','ORACLE_LOG','RedoArchDelay','CON','Reports the number of minutes from the last time that the redo log was switched. The annotation for this parameter lists the unarchived redo log and the date and time for the first entry for the redo log.',' CollLog'),
