	('6659','ORACLE_NETWORK','DBLinkOutLth','CON','Reports the average length in bytes of the messages sent to dblinks during the last interval.',' CollNetwork'),
	('6660','ORACLE_NETWORK','DBLinkMsgs','CON','Reports the number of message round trips per second from the dblinks in the last interval.',' CollNetwork'),
	('6661','ORACLE_NETWORK','DBLinkInLth','CON','Reports the average length in bytes of the messages received from dblinks during the last interval.',' CollNetwork'),
	('6662','ORACLE_NETWORK','DBLinkBytesOut','CON','Reports the number of bytes per second that were sent via SQL*Net to the dblink during the last interval.',' CollNetwork'),
