	('6669','ORACLE_PERFORMANCE','EnqWaits','CON','Graphs the total number of waits that occurred during an enqueue convert or enqueue get because the enqueue could not be granted immediately.',' CollPerformance'),
	('6670','ORACLE_PERFORMANCE','EnqTimeouts','CON','Shows the number of times an enqueue lock was requested but was not granted immediately during the last hourly reporting interval.',' CollPerformance'),
