	('6686','ORACLE_PERFORMANCE','DMLLocks','CON','Reports the total percentage of DML locks in the instance.',' CollPerformance'),
	('6687','ORACLE_PERFORMANCE','ResponseSqlTime','CON','Provides the amount of time (in milliseconds) that it takes SQL Server to execute a simple query when a sample SQL statement is executed. This parameter is formed by subtracting the connect and disconnect times from the information gathered by ResponseColl, leaving only the amount of time that the SQL Server took to execute the query.',' ResponseColl'),
	('6688','ORACLE_PERFORMANCE','ResponseExecTime','CON','Provides the total operating response time (in milliseconds). The value of this parameter includes the time it takes a sample SQL statement to connect to SQL Server, execute a simple query, and return a response. See ResponseColl for information on how to change the sample SQL statement.',' ResponseColl'),
