	('6697','ORACLE_PERFORMANCE','ExecRate','CON','Reports the statement execution rate per second for the Oracle server.',' CollPerformance'),
	('6698','ORACLE_PERFORMANCE','DiskSorts','CON','Reports the percentage of all sorts that were not performed in memory during the last interval. The annotation reports the delta values used in the calculation.',' CollPerformance'),
