	('6700','ORACLE_PERFORMANCE','CurrentTrans','CON','Reports the number of transaction enqueue locks that are held in exclusive mode.',' CollPerformance'),
	('6701','ORACLE_PERFORMANCE','ConsChgRatio','CON','Reports the percentage of consistent gets that are consistent changes. The annotation reports the delta values used in the calculation.',' CollPerformance'),
	('6702','ORACLE_PERFORMANCE','ChkpntRate','CON','Reports the average number of minutes between checkpoints.The annotation displays the number of checkpoints and their time period.',' CollPerformance'),
	('6703','ORACLE_PERFORMANCE','CallRate','CON','Reports the number of calls per second made to the database engine.',' CollPerformance'),
